import React, { useState } from 'react';
import { expensesService } from '../services/api';


// Definir categorías válidas
const VALID_CATEGORIES = [
  'alimentación',
  'transporte',
  'vivienda',
  'servicios',
  'educación',
  'entretenimiento',
  'salud',
  'otros'
];

// Funciones de validación
const isNumeric = (value, min = 0) => {
  const number = parseFloat(value);
  return !isNaN(number) && number >= min;
};

const isDate = (dateString) => {
  const date = new Date(dateString);
  return date instanceof Date && !isNaN(date);
};

export const ExpenseForm = ({ onAddExpense }) => {
  const [expenseData, setExpenseData] = useState({
    amount: '',
    category: '',
    description: '',
    date: new Date().toISOString().split('T')[0]
  });

  const [errors, setErrors] = useState({});



  const validateForm = () => {
    const newErrors = {};

    // Validar monto
    if (!expenseData.amount || parseFloat(expenseData.amount) <= 0) {
      newErrors.amount = 'Monto debe ser mayor a 0';
    }

    // Validar categoría
    if (!expenseData.category) {
      newErrors.category = 'Seleccione una categoría';
    }

    // Validar fecha
    if (!expenseData.date) {
      newErrors.date = 'Fecha es requerida';
    }

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (validateForm()) {
      try {
        const newExpense = await expensesService.create({
          amount: parseFloat(expenseData.amount),
          category: expenseData.category,
          description: expenseData.description || null,
          date: new Date(expenseData.date)
        });

        onAddExpense(newExpense);

        // Resetear formulario
        setExpenseData({
          amount: '',
          category: '',
          description: '',
          date: new Date().toISOString().split('T')[0]
        });
      } catch (error) {
        console.error('Error al guardar gasto:', error);
        setErrors({ 
          submit: 'No se pudo guardar el gasto. Intente nuevamente.' 
        });
      }
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setExpenseData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  return (
    <form onSubmit={handleSubmit} className="space-y-4">
      <div>
        <label className="block mb-2">Monto</label>
        <input
          type="number"
          name="amount"
          value={expenseData.amount}
          onChange={handleChange}
          className={`w-full p-2 border rounded ${errors.amount ? 'border-red-500' : ''}`}
          placeholder="Monto del gasto"
        />
        {errors.amount && <p className="text-red-500 text-sm">{errors.amount}</p>}
      </div>

      <div>
        <label className="block mb-2">Categoría</label>
        <select
          name="category"
          value={expenseData.category}
          onChange={handleChange}
          className={`w-full p-2 border rounded ${errors.category ? 'border-red-500' : ''}`}
        >
          <option value="">Seleccionar Categoría</option>
          {CATEGORIES.map(category => (
            <option key={category} value={category}>
              {category.charAt(0).toUpperCase() + category.slice(1)}
            </option>
          ))}
        </select>
        {errors.category && <p className="text-red-500 text-sm">{errors.category}</p>}
      </div>

      <div>
        <label className="block mb-2">Descripción (Opcional)</label>
        <input
          type="text"
          name="description"
          value={expenseData.description}
          onChange={handleChange}
          className="w-full p-2 border rounded"
          placeholder="Detalles del gasto"
        />
      </div>

      <div>
        <label className="block mb-2">Fecha</label>
        <input
          type="date"
          name="date"
          value={expenseData.date}
          onChange={handleChange}
          className={`w-full p-2 border rounded ${errors.date ? 'border-red-500' : ''}`}
        />
        {errors.date && <p className="text-red-500 text-sm">{errors.date}</p>}
      </div>

      {errors.submit && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded">
          {errors.submit}
        </div>
      )}

      <button 
        type="submit" 
        className="w-full bg-blue-500 text-white p-2 rounded hover:bg-blue-600"
      >
        Guardar Gasto
      </button>
    </form>
  );
};

export default ExpenseForm;
